                            "en_name": "parsley",
                            "category": "plant",
                            "description": "\u041C\u0430\u0433\u0434\u0430\u043D\u043E\u0437\u044A\u0442 (Petroselinum crispum) \u0435 \u0441\u0432\u0435\u0442\u043B\u043E\u0437\u0435\u043B\u0435\u043D\u043E, \u0434\u0432\u0443\u0433\u043E\u0434\u0438\u0448\u043D\u043E \u0442\u0440\u0435\u0432\u0438\u0441\u0442\u043E\n            \u0440\u0430\u0441\u0442\u0435\u043D\u0438\u0435 \u0438 \u043F\u043E\u0434\u043F\u0440\u0430\u0432\u043A\u0430, \u0448\u0438\u0440\u043E\u043A\u043E \u0440\u0430\u0437\u043F\u0440\u043E\u0441\u0442\u0440\u0430\u043D\u0435\u043D\u0430 \u0432 \u043A\u0443\u0445\u043D\u0438\u0442\u0435 \u043D\u0430 \u0411\u043B\u0438\u0437\u043A\u0438\u044F \u0438\u0437\u0442\u043E\u043A, \u0415\u0432\u0440\u043E\u043F\u0430 \u0438 \u0410\u043C\u0435\u0440\u0438\u043A\u0430.\n            \u0414\u044A\u043B\u0436\u0438 \u0443\u043F\u043E\u0442\u0440\u0435\u0431\u0430\u0442\u0430 \u0441\u0438 \u043A\u0430\u0442\u043E \u043E\u0441\u0432\u0435\u0436\u0438\u0442\u0435\u043B \u043D\u0430 \u0434\u044A\u0445\u0430 \u0438 \u0434\u043E \u0433\u043E\u043B\u044F\u043C\u0430 \u0441\u0442\u0435\u043F\u0435\u043D \u0432\u043A\u0443\u0441\u043E\u0432\u0438\u0442\u0435 \u0441\u0438 \u043A\u0430\u0447\u0435\u0441\u0442\u0432\u0430 \u043D\u0430\n            \u0432\u0438\u0441\u043E\u043A\u0430\u0442\u0430 \u043A\u043E\u043D\u0446\u0435\u043D\u0442\u0440\u0430\u0446\u0438\u044F \u043D\u0430 \u0445\u043B\u043E\u0440\u043E\u0444\u0438\u043B. \u0421\u044A\u0434\u044A\u0440\u0436\u0430 \u0433\u043B\u0438\u043A\u043E\u0437\u0438\u0434\u0430 \u0430\u043D\u0438\u043D. \u041A\u0430\u0442\u043E \u043F\u043E\u0434\u043F\u0440\u0430\u0432\u043A\u0430 \u0441\u0435 \u0438\u0437\u043F\u043E\u043B\u0437\u0432\u0430\u0442\n            \u0434\u0432\u0430 \u0432\u0438\u0434\u0430 \u043C\u0430\u0433\u0434\u0430\u043D\u043E\u0437 \u2013 \u043A\u044A\u0434\u0440\u0430\u0432\u043E\u043B\u0438\u0441\u0442 \u0438 \u0438\u0442\u0430\u043B\u0438\u0430\u043D\u0441\u043A\u0438, \u0438\u0437\u0432\u0435\u0441\u0442\u0435\u043D \u043E\u0449\u0435 \u043A\u0430\u0442\u043E \u043E\u0431\u0438\u043A\u043D\u043E\u0432\u0435\u043D \u0438\u043B\u0438 \u0433\u043B\u0430\u0434\u043A\u043E\u043B\u0438\u0441\u0442.\n            \u0412 \u0431\u044A\u043B\u0433\u0430\u0440\u0441\u043A\u0430\u0442\u0430 \u043A\u0443\u0445\u043D\u044F \u0441\u0435 \u0438\u0437\u043F\u043E\u043B\u0437\u0432\u0430 \u043F\u0440\u0435\u0434\u0438\u043C\u043D\u043E \u043E\u0431\u0438\u043A\u043D\u043E\u0432\u0435\u043D\u0438\u044F\u0442 \u043C\u0430\u0433\u0434\u0430\u043D\u043E\u0437, \u0430 \u043A\u044A\u0434\u0440\u0430\u0432\u043E\u043B\u0438\u0441\u0442\u0438\u044F\u0442 \u043C\u0430\u0433\u0434\u0430\u043D\u043E\u0437\n            \u043F\u043E\u0447\u0442\u0438 \u043D\u0435 \u0435 \u043F\u043E\u0437\u043D\u0430\u0442. \u041A\u044A\u0434\u0440\u0430\u0432\u043E\u043B\u0438\u0441\u0442\u0438\u044F\u0442 \u043C\u0430\u0433\u0434\u0430\u043D\u043E\u0437 \u0447\u0435\u0441\u0442\u043E \u0441\u0435 \u0438\u0437\u043F\u043E\u043B\u0437\u0432\u0430 \u0437\u0430 \u0434\u0435\u043A\u043E\u0440\u0430\u0446\u0438\u044F \u043D\u0430 \u044F\u0441\u0442\u0438\u044F.\n            \u0421\u043C\u044F\u0442\u0430 \u0441\u0435, \u0447\u0435 \u043E\u0431\u0438\u043A\u043D\u043E\u0432\u0435\u043D\u0438\u044F\u0442 \u043C\u0430\u0433\u0434\u0430\u043D\u043E\u0437 \u0438\u043C\u0430 \u043F\u043E-\u0441\u0438\u043B\u0435\u043D \u0430\u0440\u043E\u043C\u0430\u0442. \u0414\u0440\u0443\u0433 \u0432\u0438\u0434 \u043C\u0430\u0433\u0434\u0430\u043D\u043E\u0437\n            (Petroselinum tuberosum) \u0441\u0435 \u043E\u0442\u0433\u043B\u0435\u0436\u0434\u0430 \u0437\u0430\u0440\u0430\u0434\u0438 \u043A\u043E\u0440\u0435\u043D\u0430 \u0441\u0438.",
