                            "description": "\n            \u041E\u0431\u0438\u043A\u043D\u043E\u0432\u0435\u043D\u0438\u044F\u0442 \u0440\u0438\u0433\u0430\u043D (Origanum vulgare) \u0435 \u043C\u043D\u043E\u0433\u043E\u0433\u043E\u0434\u0438\u0448\u043D\u043E \u0442\u0440\u0435\u0432\u0438\u0441\u0442\u043E \u0440\u0430\u0441\u0442\u0435\u043D\u0438\u0435 \u043E\u0442 \u0441\u0435\u043C\u0435\u0439\u0441\u0442\u0432\u043E \u0423\u0441\u0442\u043D\u043E\u0446\u0432\u0435\u0442\u043D\u0438.\n             \u0420\u0430\u0441\u0442\u0435 \u0438\u0437 \u0445\u0440\u0430\u0441\u0442\u0430\u043B\u0430\u0446\u0438 \u0438 \u0441\u0435\u0447\u0438\u0449\u0430, \u043F\u043E \u043A\u0430\u043C\u0435\u043D\u043B\u0438\u0432\u0438 \u043C\u0435\u0441\u0442\u0430 \u0438 \u0432 \u0440\u0435\u0434\u043A\u0438 \u0433\u043E\u0440\u0438 \u043F\u0440\u0435\u0434\u0438\u043C\u043D\u043E \u0432 \u043F\u0440\u0435\u0434\u043F\u043B\u0430\u043D\u0438\u043D\u0438\u0442\u0435 \u0438 \u043F\u043B\u0430\u043D\u0438\u043D\u0438\u0442\u0435\n             \u0438\u0437 \u0446\u044F\u043B\u0430\u0442\u0430 \u0441\u0442\u0440\u0430\u043D\u0430 \u0434\u043E\u043A\u044A\u043C 1600 m \u043D\u0430\u0434\u043C\u043E\u0440\u0441\u043A\u0430 \u0432\u0438\u0441\u043E\u0447\u0438\u043D\u0430.\n            \u0420\u0438\u0433\u0430\u043D\u044A\u0442 \u0441\u0435 \u0441\u0440\u0435\u0449\u0430 \u0432 \u0434\u0438\u0432\u043E \u0441\u044A\u0441\u0442\u043E\u044F\u043D\u0438\u0435 \u043F\u043E\u0447\u0442\u0438 \u043D\u0430\u0432\u0441\u044F\u043A\u044A\u0434\u0435 \u0443 \u043D\u0430\u0441. \u041D\u0430\u0439-\u0447\u0435\u0441\u0442\u043E \u0441\u0435 \u043F\u043E\u044F\u0432\u044F\u0432\u0430 \u043F\u043E \u0441\u0435\u0447\u0438\u0449\u0430\u0442\u0430 \u0438\u0437 \u0433\u043E\u0440\u0438\u0442\u0435,\n            \u043A\u0440\u0430\u0439 \u0433\u043E\u0440\u0441\u043A\u0438\u0442\u0435 \u043F\u044A\u0442\u0435\u043A\u0438, \u043F\u043E\u043A\u0440\u0430\u0439 \u043F\u044A\u0442\u0438\u0449\u0430\u0442\u0430 \u0438 \u043F\u043E \u0432\u043B\u0430\u0436\u043D\u0438\u0442\u0435 \u043C\u0435\u0441\u0442\u0430. \u041E\u0442\u0433\u043B\u0435\u0436\u0434\u0430 \u0441\u0435 \u0438 \u043A\u0430\u0442\u043E \u043A\u0443\u043B\u0442\u0443\u0440\u043D\u043E \u0440\u0430\u0441\u0442\u0435\u043D\u0438\u0435\n            \u0437\u0430\u0440\u0430\u0434\u0438 \u0430\u0440\u043E\u043C\u0430\u0442\u0438\u0447\u043D\u043E\u0442\u043E \u043C\u0430\u0441\u043B\u043E, \u043A\u043E\u0435\u0442\u043E \u0441\u0435 \u0441\u044A\u0434\u044A\u0440\u0436\u0430 \u0432 \u0446\u044F\u043B\u0430\u0442\u0430 \u043D\u0430\u0434\u0437\u0435\u043C\u043D\u0430 \u0447\u0430\u0441\u0442 \u0438 \u043E\u0441\u043E\u0431\u0435\u043D\u043E \u0432 \u0446\u0432\u0435\u0442\u043E\u0432\u0435\u0442\u0435. \u041C\u0430\u0441\u043B\u043E\u0442\u043E\n            \u043D\u0430\u043C\u0438\u0440\u0430 \u0448\u0438\u0440\u043E\u043A\u043E \u043F\u0440\u0438\u043B\u043E\u0436\u0435\u043D\u0438\u0435 \u0432 \u043F\u0430\u0440\u0444\u044E\u043C\u0435\u0440\u0438\u044F\u0442\u0430. \u0418\u0437\u0441\u0443\u0448\u0435\u043D\u0438\u0442\u0435 \u0441\u0442\u044A\u0431\u043B\u0430 \u0441\u0430 \u0434\u043E\u0431\u044A\u0440 \u0437\u0430\u043C\u0435\u0441\u0442\u0438\u0442\u0435\u043B \u043D\u0430 \u0447\u0430\u044F. \u0423\u043F\u043E\u0442\u0440\u0435\u0431\u044F\u0432\u0430\u0442\n            \u0441\u0435 \u043F\u0440\u0438 \u043A\u0430\u0448\u043B\u0438\u0446\u0430, \u043F\u0440\u0438 \u043B\u0435\u043A\u0443\u0432\u0430\u043D\u0435 \u043D\u0430 \u0431\u0435\u043B\u043E\u0434\u0440\u043E\u0431\u043D\u0438 \u0437\u0430\u0431\u043E\u043B\u044F\u0432\u0430\u043D\u0438\u044F, \u0432\u0438\u0441\u043E\u043A\u043E \u043A\u0440\u044A\u0432\u043D\u043E \u043D\u0430\u043B\u044F\u0433\u0430\u043D\u0435. \u041A\u0430\u0442\u043E \u043F\u043E\u0434\u043F\u0440\u0430\u0432\u043A\u0430 \u0438\n            \u0437\u0430 \u043B\u0435\u0447\u0435\u0431\u043D\u0438 \u0446\u0435\u043B\u0438 \u0441\u0435 \u0438\u0437\u043F\u043E\u043B\u0437\u0432\u0430 \u0442\u043E\u0437\u0438 \u0432\u0438\u0434, \u043A\u043E\u0439\u0442\u043E \u0446\u044A\u0444\u0442\u0438 \u0441 \u0440\u043E\u0437\u043E\u0432\u043E\u0432\u0438\u043E\u043B\u0435\u0442\u043E\u0432\u0438 \u0446\u0432\u0435\u0442\u0447\u0435\u0442\u0430. \u0418\u0437\u0441\u0443\u0448\u0435\u043D \u0437\u0430\u043F\u0430\u0437\u0432\u0430 \u0432\u043A\u0443\u0441\u0430 \u0441\u0438.",
