                            "en_name": "onion",
                            "category": "plant",
                            "description": "\u041A\u0440\u043E\u043C\u0438\u0434\u044A\u0442 (Allium cepa), \u043D\u0430\u0440\u0438\u0447\u0430\u043D \u043E\u0449\u0435 \u043A\u0440\u043E\u043C\u0438\u0434 \u043B\u0443\u043A, \u0447\u0435\u0440\u0432\u0435\u043D \u043B\u0443\u043A \u0438\u043B\u0438 \u0441\u0430\u043C\u043E \u043B\u0443\u043A, \u0435\n            \u0434\u0432\u0443\u0433\u043E\u0434\u0438\u0448\u043D\u043E \u0440\u0430\u0441\u0442\u0435\u043D\u0438\u0435 \u043E\u0442 \u0440\u043E\u0434 \u041B\u0443\u043A, \u0438\u0437\u043F\u043E\u043B\u0437\u0432\u0430\u043D\u043E \u0448\u0438\u0440\u043E\u043A\u043E \u0432 \u0433\u043E\u0442\u0432\u0430\u0440\u0441\u0442\u0432\u043E\u0442\u043E. \u041E\u0441\u043D\u043E\u0432\u043D\u043E \u0441\u0435 \u0438\u0437\u043F\u043E\u043B\u0437\u0432\u0430\u0442\n            \u043B\u0443\u043A\u043E\u0432\u0438\u0446\u0438\u0442\u0435 \u043D\u0430 \u0432\u044A\u0437\u0440\u0430\u0441\u0442\u043D\u0438\u0442\u0435 \u0440\u0430\u0441\u0442\u0435\u043D\u0438\u044F \u043F\u0440\u0435\u0434\u0438 \u043D\u0430\u0447\u0430\u043B\u043E\u0442\u043E \u043D\u0430 \u0437\u0438\u043C\u0430\u0442\u0430. \u0421\u044A\u0449\u043E \u0441\u0435 \u0438\u0437\u043F\u043E\u043B\u0437\u0432\u0430\u0442 \u043B\u0438\u0441\u0442\u0430\u0442\u0430\n            \u043D\u0430 \u043C\u043B\u0430\u0434\u0438\u0442\u0435 \u0440\u0430\u0441\u0442\u0435\u043D\u0438\u044F, \u0447\u0435\u0441\u0442\u043E \u043D\u0430\u0440\u0438\u0447\u0430\u043D\u0438 \u043F\u0440\u0435\u0441\u0435\u043D \u043B\u0443\u043A \u0438\u043B\u0438 \u0437\u0435\u043B\u0435\u043D \u043B\u0443\u043A.\n            \u0418\u043C\u0430 \u0445\u0430\u0440\u0430\u043A\u0442\u0435\u0440\u0435\u043D \u0441\u0438\u043B\u0435\u043D \u043B\u044E\u0442 \u0432\u043A\u0443\u0441 \u0438 \u043E\u0441\u0442\u0440\u0430 \u043C\u0438\u0440\u0438\u0437\u043C\u0430, \u043E\u0441\u043E\u0431\u0435\u043D\u043E \u0432 \u043B\u0443\u043A\u043E\u0432\u0438\u0446\u0438\u0442\u0435. \u0422\u0435 \u0441\u0435 \u043E\u043C\u0435\u043A\u043E\u0442\u044F\u0432\u0430\u0442\n            \u043F\u0440\u0438 \u0433\u043E\u0442\u0432\u0435\u043D\u0435, \u043F\u0440\u0438 \u043A\u043E\u0435\u0442\u043E \u0432\u043A\u0443\u0441\u044A\u0442 \u0441\u0442\u0430\u0432\u0430 \u0441\u043B\u0430\u0434\u044A\u043A. \u041B\u0443\u043A\u043E\u0432\u0438\u0446\u0438\u0442\u0435 \u0438\u043C\u0430\u0442 \u0441\u0443\u0445\u0430 \u0432\u044A\u043D\u0448\u043D\u0430 \u043E\u0431\u0432\u0438\u0432\u043A\u0430 \u0438 \u043C\u0435\u0441\u0435\u0441\u0442\u0430\n            \u0441\u043B\u043E\u0435\u0441\u0442\u0430 \u0432\u044A\u0442\u0440\u0435\u0448\u043D\u043E\u0441\u0442. \u0418\u0437\u043F\u043E\u043B\u0437\u0432\u0430\u043D\u0438 \u043F\u043E \u0446\u0435\u043B\u0438\u044F \u0441\u0432\u044F\u0442 \u0437\u0430 \u043A\u0443\u043B\u0438\u043D\u0430\u0440\u043D\u0438 \u0446\u0435\u043B\u0438, \u0442\u0435 \u0438\u043C\u0430\u0442 \u0440\u0430\u0437\u043D\u043E\u043E\u0431\u0440\u0430\u0437\u043D\u0438 \u0444\u043E\u0440\u043C\u0438 \u0438 \u0446\u0432\u0435\u0442\u043E\u0432\u0435.\n            \u0410\u0440\u043F\u0430\u0434\u0436\u0438\u043A \u0441\u0435 \u043D\u0430\u0440\u0438\u0447\u0430\u0442 \u0434\u0440\u0435\u0431\u043D\u0438\u0442\u0435 \u0433\u043B\u0430\u0432\u0438 \u043A\u0440\u043E\u043C\u0438\u0434 \u043B\u0443\u043A, \u043F\u043E\u0440\u0430\u0441\u043D\u0430\u043B\u0438 \u043E\u0442 \u0441\u0435\u043C\u0435 \u0432 \u043A\u0440\u0430\u044F \u043D\u0430 \u043F\u044A\u0440\u0432\u0430\u0442\u0430 \u0433\u043E\u0434\u0438\u043D\u0430\n            \u043E\u0442 \u0437\u0430\u0441\u0430\u0436\u0434\u0430\u043D\u0435\u0442\u043E \u0438\u043C. \u0410\u0440\u043F\u0430\u0434\u0436\u0438\u043A\u044A\u0442 \u043E\u0441\u043D\u043E\u0432\u043D\u043E \u0441\u0435 \u0438\u0437\u043F\u043E\u043B\u0437\u0432\u0430 \u0437\u0430 \u043F\u043E\u0432\u0442\u043E\u0440\u043D\u043E \u0437\u0430\u0441\u044F\u0432\u0430\u043D\u0435, \u0437\u0430 \u0434\u0430 \u0441\u0435 \u043E\u0442\u0433\u043B\u0435\u0434\u0430\u0442\n            \u0435\u0434\u0440\u0438\u0442\u0435 \u0433\u043B\u0430\u0432\u0438 \u043B\u0443\u043A. \u041F\u043E\u043D\u044F\u043A\u043E\u0433\u0430 \u0441\u0435 \u0438\u0437\u043F\u043E\u043B\u0437\u0432\u0430 \u0438 \u0437\u0430 \u043F\u0440\u0438\u0433\u043E\u0442\u0432\u044F\u043D\u0435 \u043D\u0430 \u044F\u0441\u0442\u0438\u044F. ",
