                            "specific": "sprout",
                            "description": "\n            \u0413\u0440\u0430\u0445\u044A\u0442 (Pisum sativum) \u0435 \u0431\u0438\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u043D \u0432\u0438\u0434, \u0440\u0430\u0441\u0442\u0435\u043D\u0438\u0435 \u043E\u0442 \u0441\u0435\u043C\u0435\u0439\u0441\u0442\u0432\u043E \u0411\u043E\u0431\u043E\u0432\u0438 (Fabaceae).\n            \u041E\u0442\u0433\u043B\u0435\u0436\u0434\u0430 \u0441\u0435 \u043A\u0430\u0442\u043E \u0434\u043E\u043C\u0430\u0448\u043D\u0430 \u043A\u0443\u043B\u0442\u0443\u0440\u0430 \u0437\u0430 \u043F\u0440\u0435\u0445\u0440\u0430\u043D\u0430 \u043F\u043E \u0446\u0435\u043B\u0438\u044F \u0441\u0432\u044F\u0442. \u041F\u043E\u043D\u0438\u0446\u0438\u0442\u0435 \u043D\u0430 \u043F\u0440\u043E\u043B\u0435\u0442\u043D\u0438\u0442\u0435\n            \u0441\u043E\u0440\u0442\u043E\u0432\u0435 \u0433\u0440\u0430\u0445 \u043F\u043E\u043D\u0430\u0441\u044F\u0442 \u043A\u0440\u0430\u0442\u043A\u0438 \u0437\u0430\u0441\u0442\u0443\u0434\u044F\u0432\u0430\u043D\u0438\u044F \u0434\u043E \u20135, \u20136\u00B0\u0421. \u041E\u0442 \u0440\u0430\u0437\u043D\u043E\u0432\u0438\u0434\u043D\u043E\u0441\u0442\u0438\u0442\u0435 \u0441 \u043E\u0431\u0430\u0433\u0440\u0435\u043D\u0438\n            \u0446\u0432\u0435\u0442\u043E\u0432\u0435 \u0438\u043C\u0430 \u0441\u043E\u0440\u0442\u043E\u0432\u0435, \u043A\u043E\u0438\u0442\u043E \u0438\u0437\u0434\u044A\u0440\u0436\u0430\u0442 \u043D\u0430 \u043A\u0440\u0430\u0442\u043A\u0438 \u0437\u0430\u0441\u0442\u0443\u0434\u044F\u0432\u0430\u043D\u0438\u044F \u0434\u043E \u201318, \u201320\u00B0\u0421 \u0438 \u0441\u0435 \u043E\u0442\u0433\u043B\u0435\u0436\u0434\u0430\u0442\n            \u043A\u0430\u0442\u043E \u0437\u0438\u043C\u043D\u0430 \u043A\u0443\u043B\u0442\u0443\u0440\u0430 \u0432 \u0440\u0430\u0439\u043E\u043D\u0438 \u0441\u044A\u0441 \u0441\u0440\u0430\u0432\u043D\u0438\u0442\u0435\u043B\u043D\u043E \u043A\u0440\u0430\u0442\u043A\u0438 \u043A\u043E\u043B\u0435\u0431\u0430\u043D\u0438\u044F \u043D\u0430 \u0442\u0435\u043C\u043F\u0435\u0440\u0430\u0442\u0443\u0440\u0430\u0442\u0430 \u043F\u0440\u0435\u0437\n            \u0437\u0438\u043C\u043D\u0438\u044F \u043F\u0435\u0440\u0438\u043E\u0434. \u041D\u0430\u0439-\u0431\u044A\u0440\u0437\u043E \u0440\u0430\u0441\u0442\u0435 \u0433\u0440\u0430\u0445\u044A\u0442 \u043F\u0440\u0438 \u0442\u0435\u043C\u043F\u0435\u0440\u0430\u0442\u0443\u0440\u0430 \u043E\u043A\u043E\u043B\u043E 25\u00B0\u0421. \u041F\u0440\u0438 \u043F\u043E-\u043D\u0438\u0441\u043A\u0430 \u0442\u0435\u043C\u043F\u0435\u0440\u0430\u0442\u0443\u0440\u0430\n            \u0442\u043E\u0439 \u0441\u044A\u0449\u043E \u0440\u0430\u0441\u0442\u0435 \u0434\u043E\u0431\u0440\u0435 \u0438 \u0441\u0435 \u0440\u0430\u0437\u0432\u0438\u0432\u0430, \u043D\u043E \u0432\u0435\u0433\u0435\u0442\u0430\u0446\u0438\u043E\u043D\u043D\u0438\u044F\u0442 \u043C\u0443 \u043F\u0435\u0440\u0438\u043E\u0434 \u0441\u0435 \u0443\u0434\u044A\u043B\u0436\u0430\u0432\u0430, \u0430 \u043F\u0440\u0438 \u043F\u043E-\u0432\u0438\u0441\u043E\u043A\u0430\n            \u0442\u0435\u043C\u043F\u0435\u0440\u0430\u0442\u0443\u0440\u0430 \u0441\u0435 \u0441\u043A\u044A\u0441\u044F\u0432\u0430. \u0413\u0440\u0430\u0445\u044A\u0442 \u0441\u0435 \u0440\u0430\u0437\u0432\u0438\u0432\u0430 \u043D\u0430\u0439-\u0434\u043E\u0431\u0440\u0435 \u043F\u0440\u0438 \u0443\u043C\u0435\u0440\u0435\u043D\u043E \u0432\u043B\u0430\u0436\u043D\u0438 \u0443\u0441\u043B\u043E\u0432\u0438\u044F.  \u0417\u0430 \u0441\u044A\u0437\u0434\u0430\u0432\u0430\u043D\u0435\n            \u043D\u0430 \u0443\u0441\u043B\u043E\u0432\u0438\u044F \u0437\u0430 \u0431\u043B\u0430\u0433\u043E\u043F\u0440\u0438\u044F\u0442\u043D\u043E \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u0435 \u043D\u0430 \u0433\u0440\u0443\u0434\u043A\u043E\u0432\u0438\u0442\u0435 \u0431\u0430\u043A\u0442\u0435\u0440\u0438\u0438, \u0430 \u043E\u0442\u0442\u0430\u043C \u0437\u0430 \u043F\u0440\u0430\u0432\u0438\u043B\u043D\u043E \u0430\u0437\u043E\u0442\u043D\u043E \u0445\u0440\u0430\u043D\u0435\u043D\u0435\n            \u043D\u0430 \u0433\u0440\u0430\u0445\u043E\u0432\u0438\u0442\u0435 \u0440\u0430\u0441\u0442\u0435\u043D\u0438\u044F \u0435 \u043D\u0435\u043E\u0431\u0445\u043E\u0434\u0438\u043C\u0430 \u0434\u043E\u0431\u0440\u0435 \u043E\u0431\u0440\u0430\u0431\u043E\u0442\u0435\u043D\u0430 \u0438 \u0440\u0430\u0437\u0440\u043E\u0445\u043A\u0430\u043D\u0430 \u043F\u043E\u0447\u0432\u0430 \u0441 \u0434\u043E\u0441\u0442\u0430\u0442\u044A\u0447\u043D\u043E \u0432\u043B\u0430\u0433\u0430 \u0438\n            \u0434\u043E\u0431\u0440\u0430 \u0430\u0435\u0440\u0430\u0446\u0438\u044F. \u0412 \u0441\u0443\u0445\u0430 \u043F\u043E\u0447\u0432\u0430 \u0438 \u0432 \u043E\u0442\u0441\u044A\u0441\u0442\u0432\u0438\u0435 \u043D\u0430 \u0432\u044A\u0437\u0434\u0443\u0445 \u0433\u0440\u0443\u0434\u043A\u043E\u0432\u0438\u0442\u0435 \u0431\u0430\u043A\u0442\u0435\u0440\u0438\u0438 \u043F\u043E\u0441\u0442\u0435\u043F\u0435\u043D\u043D\u043E \u0437\u0430\u0433\u0438\u0432\u0430\u0442.\n            ",
