                            "description": "\n            Komatsuna \u0438\u043B\u0438 \u042F\u043F\u043E\u043D\u0441\u043A\u0438 \u0433\u043E\u0440\u0447\u0438\u0447\u0435\u043D \u0441\u043F\u0430\u043D\u0430\u043A \u0435 \u043B\u0438\u0441\u0442\u043D\u043E \u0440\u0430\u0441\u0442\u0435\u043D\u0438\u0435. \u0422\u043E\u0439 \u0435 \u0432\u0430\u0440\u0438\u0430\u043D\u0442 \u043D\u0430 \u0437\u0435\u043B\u0435\u0442\u043E.\n            \u0417\u0430 \u043F\u0440\u043E\u0434\u0430\u0436\u0431\u0430 \u0441\u0435 \u043E\u0442\u0433\u043B\u0435\u0436\u0434\u0430 \u0432 \u042F\u043F\u043E\u043D\u0438\u044F \u0438 \u0422\u0430\u0439\u0432\u0430\u043D. \u0418\u043C\u0435\u0442\u043E \u043C\u0443 \u0438\u0434\u0432\u0430 \u043E\u0442 \u044F\u043F\u043E\u043D\u0441\u043A\u043E\u0442\u043E \u0437\u0430 \"\u0417\u0435\u043B\u0435\u043D\u0438\u043D\u0430 \u043E\u0442\n            \u041A\u043E\u043C\u0430\u0442\u0441\u0443\", \u043A\u043E\u0435\u0442\u043E \u0441\u0435 \u0441\u0432\u044A\u0440\u0437\u0432\u0430  \u0441\u044A\u0441 \u0441\u0435\u043B\u043E \u043A\u044A\u0434\u0435\u0442\u043E \u0440\u0430\u0441\u0442\u0435\u043D\u0438\u0435\u0442\u043E \u0435 \u0431\u0438\u043B\u043E \u0448\u0438\u0440\u043E\u043A\u043E \u043E\u0442\u0433\u043B\u0435\u0436\u0434\u0430\u043D\u043E.\n            \u041C\u043E\u0436\u0435 \u0434\u0430 \u043F\u044A\u0440\u0436\u0438, \u0432\u0430\u0440\u0438 , \u0434\u0430 \u0441\u0435 \u0434\u043E\u0431\u0430\u0432\u044F \u0432 \u0441\u0443\u043F\u0438, \u043F\u0440\u0435\u0441\u043D\u0438 \u0441\u0430\u043B\u0430\u0442\u0430 \u0438  \u0435 \u0434\u043E\u0431\u044A\u0440 \u0438\u0437\u0442\u043E\u0447\u043D\u0438\u043A \u043D\u0430 \u043A\u0430\u043B\u0446\u0438\u0439.\n            \u041B\u0438\u0441\u0442\u0430\u0442\u0430 \u043D\u0430 \u043A\u043E\u043C\u0430\u0442\u0441\u0443\u043D\u0430\u0442\u0430 \u043C\u043E\u0433\u0430\u0442 \u0434\u0430 \u0441\u0435 \u044F\u0434\u0430\u0442 \u043D\u0430 \u0432\u0441\u0435\u043A\u0438 \u0435\u0442\u0430\u043F \u043E\u0442 \u0442\u0435\u0445\u043D\u0438\u044F \u0440\u0430\u0441\u0442\u0435\u0436. \u0412 \u0437\u0440\u0435\u043B\u0438\u044F \u0441\u0438\n            \u043F\u0435\u0440\u0438\u043E\u0434 \u0440\u0430\u0441\u0442\u0435\u043D\u0438\u0435\u0442\u043E \u0435 \u0442\u044A\u043C\u043D\u043E \u0437\u0435\u043B\u0435\u043D\u043E \u0441\u044A\u0441 \u0437\u0435\u043B\u0435\u043D\u0438 \u0447\u0435\u0440\u0442\u0438,, \u043E\u043A\u043E\u043B\u043E 30 \u0441\u0430\u043D\u0442\u0438\u043C\u0435\u0442\u0440\u0438 \u0434\u044A\u043B\u0433\u043E \u0438 18 \u0448\u0438\u0440\u043E\u043A\u043E.\n            \u041D\u0430\u0439 \u0447\u0435\u0441\u0442\u043E \u0441\u0435 \u043E\u0442\u0433\u043B\u0435\u0436\u0434\u0430 \u0432 \u0435\u0441\u0435\u043D\u0442\u0430 \u0438\u043B\u0438 \u043F\u0440\u043E\u043B\u0435\u0442\u0442\u0430, \u0442\u044A\u0439 \u043A\u0430\u0442\u043E \u043D\u0435 \u043C\u043E\u0436\u0435 \u0434\u0430 \u0438\u0437\u0434\u044A\u0440\u0436\u0430 \u043D\u0430 \u043C\u043D\u043E\u0433\u043E \u0432\u0438\u0441\u043E\u043A\u0438\n            \u0438 \u043C\u043D\u043E\u0433\u043E \u043D\u0438\u0441\u043A\u0438 \u0442\u0435\u043C\u043F\u0435\u0440\u0430\u0442\u0443\u0440\u0438. \u0418\u0437\u043F\u043E\u043B\u0437\u0432\u0430 \u0441\u0435 \u0437\u0430 \u0444\u0443\u0440\u0430\u0436 \u0432 \u043D\u044F\u043A\u043E\u0438 \u0430\u0437\u0438\u0430\u0442\u0441\u043A\u0438 \u0434\u044A\u0440\u0436\u0430\u0432\u0438.\n            ",
