                            "description": "\n            \u0421\u043C\u0438\u043D\u0434\u0443\u0445\u044A\u0442 (Trigonella foenum-graecum), \u0438\u0437\u0432\u0435\u0441\u0442\u0435\u043D \u043E\u0449\u0435 \u043A\u0430\u0442\u043E \u0447\u0438\u043C\u0435\u043D, e \u0435\u0434\u043D\u043E\u0433\u043E\u0434\u0438\u0448\u043D\u043E \u0440\u0430\u0441\u0442\u0435\u043D\u0438\u0435 \u043E\u0442\n            \u0441\u0435\u043C\u0435\u0439\u0441\u0442\u0432\u043E \u0411\u043E\u0431\u043E\u0432\u0438. \u0421\u0435\u043C\u0435\u043D\u0430\u0442\u0430 \u0438 \u043B\u0438\u0441\u0442\u0430\u0442\u0430 \u043C\u0443 \u0441\u0435 \u0438\u0437\u043F\u043E\u043B\u0437\u0432\u0430\u0442 \u043A\u0430\u0442\u043E \u043F\u043E\u0434\u043F\u0440\u0430\u0432\u043A\u0430. \u0420\u043E\u0434\u0438\u043D\u0430\u0442\u0430 \u043D\u0430 \u0447\u0438\u043C\u0435\u043D\u0430\n            \u0441\u0430 \u0437\u0435\u043C\u0438\u0442\u0435 \u043E\u043A\u043E\u043B\u043E \u0421\u0440\u0435\u0434\u0438\u0437\u0435\u043C\u043D\u043E \u043C\u043E\u0440\u0435, \u043D\u043E \u0442\u043E\u0439 \u0435 \u043F\u043E\u0437\u043D\u0430\u0442 \u0438 \u0432 \u041A\u0438\u0442\u0430\u0439, \u0418\u043D\u0434\u0438\u044F \u0438 \u0421\u0435\u0432\u0435\u0440\u043D\u0430 \u0410\u0444\u0440\u0438\u043A\u0430.\n            \u0421\u0435\u043C\u0435\u043D\u0430\u0442\u0430 \u043C\u0443 \u0441\u0430 \u0438\u0437\u043F\u043E\u043B\u0437\u0432\u0430\u043D\u0438 \u043A\u0430\u0442\u043E \u043F\u043E\u0434\u043F\u0440\u0430\u0432\u043A\u0430 \u0438 \u043B\u0435\u0447\u0435\u0431\u043D\u043E \u0440\u0430\u0441\u0442\u0435\u043D\u0438\u0435 \u043E\u0442 \u0435\u0433\u0438\u043F\u0442\u044F\u043D\u0438, \u0433\u044A\u0440\u0446\u0438 \u0438 \u0440\u0438\u043C\u043B\u044F\u043D\u0438.\n             \u0415\u0433\u0438\u043F\u0435\u0442\u0441\u043A\u0438\u0442\u0435 \u0432\u043E\u0438\u043D\u0438 \u0441\u0430 \u0433\u043E \u043F\u043E\u043B\u0437\u0432\u0430\u043B\u0438 \u043A\u0430\u0442\u043E \u043D\u0430\u043F\u0438\u0442\u043A\u0430 \u043F\u0440\u0435\u0434\u0438 \u0431\u0438\u0442\u043A\u0430.\n            \u0418\u0437\u0441\u0443\u0448\u0435\u043D\u0430\u0442\u0430 \u0438 \u0441\u0442\u0440\u0438\u0442\u0430 \u0430\u0440\u043E\u043C\u0430\u0442\u043D\u0430 \u043F\u043E\u0434\u043F\u0440\u0430\u0432\u043A\u0430, \u043A\u043E\u044F\u0442\u043E \u0432 \u0442\u043E\u0437\u0438 \u0432\u0438\u0434 \u0435 \u0435\u0434\u043D\u0430 \u043E\u0442 \u043E\u0441\u043D\u043E\u0432\u043D\u0438\u0442\u0435 \u0441\u044A\u0441\u0442\u0430\u0432\u043A\u0438 \u0432\n            \u0442\u0440\u0430\u0434\u0438\u0446\u0438\u043E\u043D\u043D\u0430\u0442\u0430 \u0431\u044A\u043B\u0433\u0430\u0440\u0441\u043A\u0430 \u0441\u043C\u0435\u0441 \u043E\u0442 \u043F\u043E\u0434\u043F\u0440\u0430\u0432\u043A\u0438 \u0448\u0430\u0440\u0435\u043D\u0430 \u0441\u043E\u043B. \u041F\u0440\u0438 \u043D\u0430\u0441 \u0437\u0430 \u0448\u0430\u0440\u0435\u043D\u0430 \u0441\u043E\u043B \u0441\u0435 \u043F\u043E\u043B\u0437\u0432\u0430\n            \u043F\u0440\u0435\u0434\u0438\u043C\u043D\u043E \u043F\u043E\u043B\u0441\u043A\u0438 \u0441\u043C\u0438\u043D\u0434\u0443\u0445 \u2014 Trigonella caerulea.\n            \u0412 \u0434\u0440\u0443\u0433\u0438 \u0441\u0442\u0440\u0430\u043D\u0438 \u0441\u0435 \u044F\u0434\u0430\u0442 \u0438 \u043A\u044A\u043B\u043D\u043E\u0432\u0435\u0442\u0435, \u0441\u0432\u0435\u0436\u0430\u0442\u0430 \u043B\u0438\u0441\u0442\u043D\u0430 \u043C\u0430\u0441\u0430 \u0441\u0435 \u0441\u043B\u0430\u0433\u0430 \u0432 \u043A\u0430\u0440\u0442\u043E\u0444\u0435\u043D\u0430 \u044F\u0445\u043D\u0438\u044F.\n            ",
