                            "ph": "6.0 - 6.5",
                            "description": "\n            \u0415\u043B\u0434\u0430 (Fagopyrum) \u0435 \u0440\u043E\u0434 \u043F\u043E\u043A\u0440\u0438\u0442\u043E\u0441\u0435\u043C\u0435\u043D\u043D\u0438 \u0440\u0430\u0441\u0442\u0435\u043D\u0438\u044F \u043E\u0442 \u0441\u0435\u043C\u0435\u0439\u0441\u0442\u0432\u043E \u041B\u0430\u043F\u0430\u0434\u043E\u0432\u0438 (Polygonaceae).\n            \u041D\u044F\u043A\u043E\u0438 \u0432\u0438\u0434\u043E\u0432\u0435 \u0441\u0435 \u0438\u0437\u043F\u043E\u043B\u0437\u0432\u0430\u0442 \u043A\u0430\u0442\u043E \u0437\u044A\u0440\u043D\u0435\u043D\u0430 \u0445\u0440\u0430\u043D\u0430, \u0432\u044A\u043F\u0440\u0435\u043A\u0438 \u0447\u0435 \u043D\u0435 \u0441\u0430 \u0447\u0430\u0441\u0442 \u043E\u0442 \u0441\u0435\u043C\u0435\u0439\u0441\u0442\u0432\u043E \u0416\u0438\u0442\u043D\u0438\n            (Poaceae). \u0417\u0430 \u043F\u044A\u0440\u0432\u0438 \u043F\u044A\u0442 \u0445\u043E\u0440\u0430\u0442\u0430 \u0437\u0430\u043F\u043E\u0447\u0432\u0430\u0442 \u0434\u0430 \u044F \u043E\u0442\u0433\u043B\u0435\u0436\u0434\u0430\u0442 \u043E\u0449\u0435 \u043F\u0440\u0435\u0434\u0438 6000 \u0433\u043E\u0434\u0438\u043D\u0438 \u0432 \u042E\u0433\u043E\u0438\u0437\u0442\u043E\u0447\u043D\u0430 \u0410\u0437\u0438\u044F.\n            \u0412 \u0418\u043D\u0434\u0438\u044F \u043D\u0430\u0440\u0438\u0447\u0430\u0442 \u0435\u043B\u0434\u0430\u0442\u0430 \"\u0447\u0435\u0440\u0435\u043D \u043E\u0440\u0438\u0437\", \u0430 \u0432 \u0434\u0440\u0443\u0433\u0438\u0442\u0435 \u0441\u0442\u0440\u0430\u043D\u0438 \u0435 \u0438\u0437\u0432\u0435\u0441\u0442\u043D\u0430 \u043A\u0430\u0442\u043E \"\u0447\u0435\u0440\u043D\u0430 \u043F\u0448\u0435\u043D\u0438\u0446\u0430\".\n            \u0421\u043B\u0435\u0434 \u0441\u0442\u0430\u0440\u0442\u0430 \u043D\u0430 \u043C\u0430\u0441\u043E\u0432\u043E\u0442\u043E \u0439 \u043E\u0442\u0433\u043B\u0435\u0436\u0434\u0430\u043D\u0435 \u0442\u044F \u0431\u044A\u0440\u0437\u043E \u0441\u0438 \u0441\u043F\u0435\u0447\u0435\u043B\u0432\u0430 \u0441\u043B\u0430\u0432\u0430\u0442\u0430 \u043D\u0430 \u0435\u0434\u043D\u0430 \u043E\u0442\n            \u043D\u0430\u0439-\u0440\u0430\u0437\u043F\u0440\u043E\u0441\u0442\u0440\u0430\u043D\u0435\u043D\u0438\u0442\u0435 \u0445\u0440\u0430\u043D\u0438 \u0437\u0430 \u043F\u043E-\u0431\u0435\u0434\u043D\u0438\u0442\u0435 \u043E\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043D\u0438 \u0441\u043B\u043E\u0435\u0432\u0435. \u0420\u043E\u0434\u0438\u043D\u0430\u0442\u0430 \u043D\u0430 \u0435\u043B\u0434\u0430\u0442\u0430 \u0435\n            \u0418\u043D\u0434\u0438\u044F, \u043D\u043E \u043D\u0430\u0439-\u043F\u043E\u043F\u0443\u043B\u044F\u0440\u043D\u0430 \u0435 \u0432 \u0420\u0443\u0441\u0438\u044F (\u043D\u0430\u0440\u0438\u0447\u0430\u0442 \u044F \u201E\u0433\u0440\u0435\u0447\u043A\u0430\u201C). \u0415\u0434\u043D\u043E\u0433\u043E\u0434\u0438\u0448\u043D\u0430\u0442\u0430 \u0435\u043B\u0434\u0430 \u0435 \u0440\u0430\u0441\u0442\u0435\u043D\u0438\u0435\n            \u0441 \u0431\u0435\u043B\u0438 \u0446\u0432\u0435\u0442\u043E\u0432\u0435 \u0438 \u0441 \u043F\u043B\u043E\u0434 - \u0442\u043E\u0440\u0431\u0435\u0441\u0442\u0438 \u043A\u0443\u0442\u0438\u0439\u043A\u0438.  \u0422\u044F \u0443\u0432\u0435\u043B\u0438\u0447\u0430\u0432\u0430 \u043C\u0443\u0441\u043A\u0443\u043B\u043D\u0430\u0442\u0430 \u0441\u0438\u043B\u0430 \u0438 \u0438\u0437\u0434\u0440\u044A\u0436\u043B\u0438\u0432\u043E\u0441\u0442.\n            \u0421\u044A\u0449\u043E \u0442\u0430\u043A\u0430 \u0435 \u043F\u043E\u043B\u0435\u0437\u043D\u0430 \u0437\u0430 \u0441\u043F\u043E\u0440\u0442\u0443\u0432\u0430\u0449\u0438\u0442\u0435. \u0421\u044A\u0434\u044A\u0440\u0436\u0430 \u0436\u0435\u043B\u044F\u0437\u043E, \u043A\u0430\u043B\u0446\u0438\u0439, \u043A\u0430\u043B\u0438\u0439, \u0444\u043E\u0441\u0444\u043E\u0440, \u0439\u043E\u0434, \u0446\u0438\u043D\u043A \u0438 \u0434\u0440.\n            \u0415\u043B\u0434\u0430\u0442\u0430 \u043F\u043E\u0434\u0445\u0440\u0430\u043D\u0432\u0430 \u043A\u043E\u0436\u0430\u0442\u0430, \u043A\u043E\u0441\u0430\u0442\u0430 \u0438 \u043D\u043E\u043A\u0442\u0438\u0442\u0435. \u0421\u044A\u0449\u043E \u0441\u044A\u0434\u044A\u0440\u0436\u0430 \u043E\u0440\u0433\u0430\u043D\u0438\u0447\u043D\u0438 \u043A\u0438\u0441\u0435\u043B\u0438\u043D\u0438  \u0438 \u0432\u0438\u0442\u0430\u043C\u0438\u043D\u0438\u0442\u0435\n            \u0410, \u0421, PP, \u0420. \u0411\u043E\u0433\u0430\u0442\u0430 \u0435 \u043D\u0430 \u0444\u043B\u0430\u0432\u043E\u043D\u043E\u0438\u0434\u0438, \u043A\u043E\u0438\u0442\u043E \u043F\u043E\u043C\u0430\u0433\u0430\u0442 \u0437\u0430 \u0437\u0430\u0431\u0430\u0432\u044F\u043D\u0435 \u043F\u0440\u043E\u0446\u0435\u0441\u0438\u0442\u0435 \u043D\u0430 \u0441\u0442\u0430\u0440\u0435\u0435\u043D\u0435.\n            ",
